function [y,p]=kr(omega,lamda,mu)
%% Rayleigh Wave Number
kp=omega/sqrt(lamda+2*mu);
ks=omega/sqrt(mu);
p=[16*(kp*kp-ks*ks), 24*ks^4-16*ks^2*kp^2, -8*ks^6, ks^8];
y=[roots(p);ks*ks;kp*kp];
x=linspace(0,13,200);
plot(x,polyval(p,x));
%yy=(((ks^8/(2*(16*kp^2 - 16*ks^2)) + (- 16*kp^2*ks^2 + 24*ks^4)^3/(27*(16*kp^2 - 16*ks^2)^3) + (4*ks^6*(- 16*kp^2*ks^2 + 24*ks^4))/(3*(16*kp^2 - 16*ks^2)^2))^2 - ((8*ks^6)/(3*(16*kp^2 - 16*ks^2)) + (- 16*kp^2*ks^2 + 24*ks^4)^2/(9*(16*kp^2 - 16*ks^2)^2))^3)^(1/2) - (- 16*kp^2*ks^2 + 24*ks^4)^3/(27*(16*kp^2 - 16*ks^2)^3) - ks^8/(2*(16*kp^2 - 16*ks^2)) - (4*ks^6*(- 16*kp^2*ks^2 + 24*ks^4))/(3*(16*kp^2 - 16*ks^2)^2))^(1/3) + ((8*ks^6)/(3*(16*kp^2 - 16*ks^2)) + (- 16*kp^2*ks^2 + 24*ks^4)^2/(9*(16*kp^2 - 16*ks^2)^2))/(((ks^8/(32*kp^2 - 32*ks^2) + (24*ks^4 - 16*kp^2*ks^2)^3/(27*(16*kp^2 - 16*ks^2)^3) + (4*ks^6*(24*ks^4 - 16*kp^2*ks^2))/(3*(16*kp^2 - 16*ks^2)^2))^2 - ((8*ks^6)/(48*kp^2 - 48*ks^2) + (24*ks^4 - 16*kp^2*ks^2)^2/(9*(16*kp^2 - 16*ks^2)^2))^3)^(1/2) - (24*ks^4 - 16*kp^2*ks^2)^3/(27*(16*kp^2 - 16*ks^2)^3) - ks^8/(32*kp^2 - 32*ks^2) - (4*ks^6*(24*ks^4 - 16*kp^2*ks^2))/(3*(16*kp^2 - 16*ks^2)^2))^(1/3) - (- 16*kp^2*ks^2 + 24*ks^4)/(3*(16*kp^2 - 16*ks^2));
%y=yy;
